import React from 'react';
import { useState } from 'react';
import './Styles/Home.css';

const Home = () => {

    const [tab, setTab] = useState("home");
    return (
        <>
        <div className="home-container">
            <ul>
                <li onClick={() => setTab("home")}>Home Component</li>
                <li onClick={() => setTab("home")}>History Component</li>
                <li onClick={() => setTab("home")}>ID Component</li>
            </ul>

            {tab === "bookmark"}
            {tab === "search" }
            {tab === "share" }
        </div>
        </>
    );
};

export default Home;
